import AccountNavbar from "../../../components/account/AccountNavbar/AccountNavbar";

import AccountSidebar from "../../../components/account/AccountSidebar/AccountSidebar";

import User from "../../../assets/icons/user.png"

import { useState } from "react";

import ".././Clients.css"

const Profile = () => {
  const [sidebar, showSidebar] = useState(false);

  const handleShowSidebar = () => {
    showSidebar(!sidebar);
  };

  return (
    <div className="orders account">
      <AccountNavbar sidebar={sidebar} handleShowSidebar={handleShowSidebar} title="PROFILE" />
      <AccountSidebar sidebar={sidebar} />
      <p className="empty"></p>

      <div className="container">
        <div className="profile-container">
          <div className="col">
            <img src={User} alt="" />
          </div>
        </div>
      </div>

    </div>
  );
};

export default Profile;
